// GetSheetsData returns the loaded sheets data.
func GetSheetsData() *SheetsChummer {
	return sheetsData
}

// GetAllSheets returns all sheets.
func GetAllSheets() []Sheet {
	if len(sheetsData.Sheets) == 0 {
		return []Sheet{}
	}
	return sheetsData.Sheets[0].Sheet
}

// GetSheetByID returns the sheet with the given ID, or nil if not found.
func GetSheetByID(id string) *Sheet {
	sheets := GetAllSheets()
	for i := range sheets {
		if sheets[i].ID == id {
			return &sheets[i]
		}
	}
	return nil
}
